import React from 'react';
import './style.css';
import { Container, Col, Row } from 'react-bootstrap';
import NewItemContainer from '../NewItemContainer/index.js';
import ItemContainer from '../ItemContainer/index.js';

class AppContainer extends React.Component{

	render(){
		const { infos, onInputChange, addItem } = this.props;

		return(
			<Container className="appContainer">
				<Row>
					<Col className='newItemContainer'>
						<NewItemContainer infos={infos}
		      				  onInputChange={onInputChange}
		      				  addItem={addItem}/>
					</Col>
					<Col className='checkoutContainer'>
						<ItemContainer/>
					</Col>
				</Row>

			</Container>
		)
	}
}

export default AppContainer;
